# @param {Integer[]} nums
# @return {Integer[]}

def find_disappeared_numbers_r(nums)
  new_arr = [*1..nums.size]
  new_arr - nums
end

def find_disappeared_numbers(nums)
  nums.sort!
  n = nums.size
  result, idx, number = [], 0, 1

  while idx < n do
    if nums[idx] == number 
      number += 1
      idx += 1
    elsif nums[idx] > number 
      result << number
      number += 1
    # elsif idx == n-1 && number <= n
    #   result << number
    #   idx += 1
    else
      idx += 1
    end
    # p "#{idx} - #{number}"
  end
    result.concat([*number..n]) if result[-1] != n && number <= n
    result
end

